Colorado&#39;s mountainous landscape, skyscraping trees and cool breeze are home to close friends Garrett Lucero and Brian Helander who formed Last Heroes in 2016. The valorous moniker came to be by the duo&#39;s hopes of creating a platform that would bring people together, and remind everyone that they have a purpose in life. Big or small, visible or not, everyone has an impact that ripples. 

Their mission is soundtracked by emotionally-charged, melodic music that seamlessly weaves dance, indie and folk influences. Early champions of their music include <a href="spotify:artist:6fcTRFpz0yH79qSKfof7lp" data-name="Seven Lions">Seven Lions</a> who signed their debut EP &#39;Moments&#39; to his tastemaker imprint Ophelia Records. Last Heroes toured with Seven Lions across the U.S. shortly after and eventually collaborated with him and <a href="spotify:artist:1sKIizVYeHkGy7Tjmn9QRj" data-name="HALIENE">HALIENE</a> on melodic bass anthem &#34;Don&#39;t Wanna Fall.&#34; These milestones helped build their touring footprint as the duo has performed alongside the likes of <a href="spotify:artist:45eNHdiiabvmbp4erw26rg" data-name="ILLENIUM">ILLENIUM</a>, <a href="spotify:artist:7lZauDnRoAC3kmaYae2opv" data-name="Dabin">Dabin</a> and <a href="spotify:artist:6CCTvLyIHqUhY6VQizt150" data-name="Jason Ross">Jason Ross</a>. 

To date, Last Heroes&#39; catalog boasts 55 million total streams with standout records such as &#34;Love Like Us&#34; off their &#39;Finding Light&#39; EP and &#34;Change It&#34; off their &#39;Threads&#39; EP. However, Garrett and Brian now have their sights set on an even greater body of work. “A year ago, we took a trip into the mountains and began writing what would become our debut album,&#34; they say. &#34;Since then, we&#39;ve lived a whole lot of life, and put new and old emotions into this music. We&#39;re so ready to put all this hard work out into the world and share these stories with you.&#34;

